import React from "react";
import Counters from "../Counters";
import Tabs from "../Tabs";
import TabContent from "../TabContent";
import CardStore from "../CardStore";
import "../styles/Page.css";
import "../styles/StorePage.css";
import gamepadStoreIcon from "../images/gamepadStore.png";
import energyLogo from "../images/EnergyLogo.png";

export function StorePage(props){

    let cardsConsole = [{
        cardName: "МультиТап",
        cardImage: gamepadStoreIcon,
        cardUpdateType: "click",
        cardUpdateData: 1,
        cardLevel: 1,
        cardPrice: 50
    },
    {
        cardName: "Банка Энергии",
        cardImage: energyLogo,
        cardUpdateType: "energy",
        cardUpdateData: 10,
        cardLevel: 1,
        cardPrice: 100
    }
    ];



    return (
        <div className="StorePage Page">
            <Counters isDisabledDataCounters={false} money={props.money}/>
            <Tabs />
            <TabContent>
                {cardsConsole.map(item => <CardStore cardName={item.cardName} image={item.cardImage} />)}
            </TabContent>
        </div>
    );
};
